import React, { Component } from 'react';
import Navbar from '../navbar/Navbar';
import Topbar from '../navbar/Topbar';
import ChatIcon from '@material-ui/icons/QuestionAnswer'
import { Link } from 'react-router-dom'
import GroupSearch from '../Groups/Groups'





export default class Home extends Component {


  goToGroups = () => {
    console.log('run')
    this.props.history.push('/groups');
  }

  printGroups = () => {
    return this.props.currentUser.trackStock.map(ele => {
      return (
        <div>
          <Link to={`/chat/${ele}`} ><ChatIcon/> {ele}</Link>
        </div>
      )
    })
  }



  render() {
    console.log(this.props.currentUser);
    //LOG OUT FUNCTION HANDLER
    const goToChat = () => {
      this.props.history.push('/home/chat');
      console.log(this.props.currentUser)
    }
    const goToImage = () => {
      this.props.history.push('/home/image');
    }

    return (
      <div>
      <Topbar/>
        <div>
        <h1 style={{textAlign:'center', color: '#0095ff', textShadow: '2px 2px #b5bbbd'}}>Welcome, {this.props.currentUser.displayName}</h1>
        <div>
        <Link to='/creategroup' style={{color:"#0095ff"}} ><h4 style={{textAlign: 'end', marginRight: '10px', marginBottom:'0'}}>Start a group</h4></Link>
          <h2 style={{marginLeft: '10px', marginTop: '0', color:"#0095ff", marginBottom:'0'}}>Groups</h2>
        </div>
        </div>
       <GroupSearch/>
        <div style={{marginLeft:'10px', marginRight: '10px'}}>


         <button onClick={goToChat}>go to chat</button>        
          <button onClick={goToImage}>check img</button>
          <hr/>
          {this.printGroups()}
          <hr/>
        </div>
        <Navbar/>
      </div>
    );
  }
}
